import Footer from '../components/Footer'
import '../stylesheets/CarList.css'
import Banner from '../components/Banner'

const CarList = () => {

  const [cars, setCars] = useState("");
  
  useEffect(() => {
    const fetchdata = async () => {
      const data = await axios.get("/cars/get");
